import { Text, TouchableOpacity, View } from 'react-native';
import styles from '../styles/ButtonsStyle';

const AppButton= ({props, navigation}) => {
  return (
    <View style={styles.buttonContainer}>
      <TouchableOpacity onPress={() => navigation.navigate(props.route)} style={styles.appButtonContainer}>
          <Text style={styles.appButtonText}>{props.text}</Text>
      </TouchableOpacity>

      { /* if props.icon == true ? <show search icon> </show> : appbutonc */ }
    </View>
  )
}
export default AppButton;
